import Head from 'next/head';
import Navbar from '../components/navbar';
import Footer from '../components/footer';
import { Fragment } from 'react';

const Layout = (props) => {
    console.log(props)
    return (
        <Fragment>
            <Head>
                <title>My page</title>
            </Head>
            <Navbar/>
            {props.children}

            <Footer/>
        </Fragment>

    );
}

export default Layout;
